    [],nt"num_tags": 5,nt"name": "snake-creek-national-wildlife-refuge-narrative-report-january-through-december-1966",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Snake
    Creek National Wildlife Refuge outlines Refuge accomplishments during the 1966 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, collections and receipts, vegetation
    control, and wildfires. Resource management is outlined; topics include grazing
    and fur harvesting. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, and violations. Items of interest,
    N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
